import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  const [] = []

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      result.forEach(item => data.push(item))
      return data
    })
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      {data}
    </div>
  </div>
  )
}

export default HomePage
